import React from "react";
import headerNavbar from "./HeaderNavbar.module.css"
import {NavLink} from "react-router-dom";



const HeaderNavbar = (props) => {
    const setActive = ({isActive}) => isActive ? 'active' : '';
    return (
        <ul className={headerNavbar.list}>
            <NavLink to={"/home"} className={setActive}>Home</NavLink>
            <NavLink to={"/products"} className={setActive}>Products</NavLink>
            <NavLink to={"/chats"} className={setActive}>Chats</NavLink>
        </ul>
    )
}

export default HeaderNavbar
